import React, {useState} from 'react'
import { AppBar, IconButton } from '@mui/material'
import Box from '@mui/material/Box'
import Toolbar from '@mui/material/Toolbar'
import Typography from '@mui/material/Typography'
import Button from '@mui/material/Button'
import Avatar from '@mui/material/Avatar'
import { Link } from "react-router-dom"
import Menu from '@mui/material/Menu'
import Container from '@mui/material/Container'
import HomeIcon from '@mui/icons-material/Home'
import Tooltip from '@mui/material/Tooltip';
import GroupsIcon from '@mui/icons-material/Groups';
import LocalShippingIcon from '@mui/icons-material/LocalShipping';
import NotesIcon from '@mui/icons-material/Notes';
import ShowChartIcon from '@mui/icons-material/ShowChart';
import AutoStoriesIcon from '@mui/icons-material/AutoStories';
import ScienceIcon from '@mui/icons-material/Science';
import MenuIcon from '@mui/icons-material/Menu';
import MenuItem from '@mui/material/MenuItem';
import List from '@mui/material/List';
import ListItem from '@mui/material/ListItem';
import ListItemButton from '@mui/material/ListItemButton';
import ListItemIcon from '@mui/material/ListItemIcon';
import ListItemText from '@mui/material/ListItemText';
import {Drawer} from "@mui/material"



const Appbar = () => {
    const [anchorElNav, setAnchorElNav] = React.useState(null);
    const [isDrawerOpen, setIsDrawerOpen] = useState(false);


    const handleOpenNavMenu = (event) => {
        setAnchorElNav(event.currentTarget);
      };
      const handleOpenDrawer = (event) => {
        isDrawerOpen();
      };

      const handleCloseNavMenu = () => {
        setAnchorElNav(null);
      };

      const handleCloseDrawer = () => {
        setAnchorElUser(null);
      };
  return (
    <div className="AppBar">
    <Box sx={{flexGrow: 1 }}>
        <AppBar position="static" color="transparent">
            <Container maxWidth="x1">
            <Toolbar disableGutters="true" >
            <HomeIcon sx={{ display: { xs: 'none', md: 'flex' }, mr: 1 }} />
          <Typography
            variant="h6"
            noWrap
            component="a"
            href="/"
            sx={{
              mr: 2,
              display: { xs: 'none', md: 'flex' },
              fontFamily: 'monospace',
              fontWeight: 700,
              letterSpacing: '.3rem',
              color: 'inherit',
              textDecoration: 'none',
            }}
          >
            LOGO
          </Typography>

          <Box sx={{ flexGrow: 1, display: { xs: 'flex', md: 'none' } }}>
            <IconButton
              size="large"
              aria-label="account of current user"
              aria-controls="menu-appbar"
              aria-haspopup="true"
              onClick={handleOpenNavMenu}
              color="inherit"
            >
              <MenuIcon />
            </IconButton>
            <List
              id="menu-appbar"
              anchorEl={anchorElNav}
              anchorOrigin={{
                vertical: 'bottom',
                horizontal: 'left',
              }}
              keepMounted
              transformOrigin={{
                vertical: 'top',
                horizontal: 'left',
              }}
              open={Boolean(anchorElNav)}
              onClose={handleCloseNavMenu}
              sx={{
                display: { xs: 'block', md: 'none' },
              }}
            >
                <ListItemButton onClick={handleCloseNavMenu}><Link style={{textDecoration:'none' }} to="home"></Link>Home</ListItemButton>
                <ListItemButton onClick={handleCloseNavMenu}><Link style={{textDecoration:'none' }} to="problem"></Link>Problem</ListItemButton>
                <ListItemButton onClick={handleCloseNavMenu}><Link style={{textDecoration:'none' }} to="team"></Link>Team</ListItemButton>
                <ListItemButton onClick={handleCloseNavMenu}><Link style={{textDecoration:'none' }} to="home"></Link>Home</ListItemButton>
            </List>
          </Box>
          <HomeIcon sx={{ display: { xs: 'flex', md: 'none' }, mr: 1 }} />
          <Typography
            variant="h5"
            noWrap
            component="a"
            href=""
            sx={{
              mr: 2,
              display: { xs: 'flex', md: 'none' },
              flexGrow: 1,
              fontFamily: 'monospace',
              fontWeight: 700,
              letterSpacing: '.3rem',
              color: 'inherit',
              textDecoration: 'none',
            }}
          >
            LOGO
          </Typography>
          <Box sx={{ flexGrow: 1, display: { xs: 'none', md: 'flex' } }}>
              <Button
                key="home"
                onClick={handleCloseNavMenu}
                sx={{ my: 2, color: 'white', display: 'block' }}
              >
                Home
              </Button>
          </Box>

          <Box sx={{ flexGrow: 0 }}>
              <IconButton onClick={handleOpenDrawer} sx={{ p: 0 }}>
                <MenuIcon/>
              </IconButton>
          </Box>





            </Toolbar>
            </Container>
        </AppBar>
    </Box>
    <Drawer anchor='right' open={isDrawerOpen} onClose={ () => setIsDrawerOpen(false)}>
      <Box p={2}
        width='250px'
        textAlign='center'
        role='presentation'>
          <Typography variant='h6' component='div'>
            Side Panel
          </Typography>
        </Box>
    </Drawer>
    </div>
  )
}

export default Appbar
